				<h2>Maintenance and Security Release</h2>
				<p>
					<strong>Version 6.5.3</strong> addressed 21 bugs.					For more information, see <a href="https://wordpress.org/support/wordpress-version/version-6-5-3/">the release notes</a>.				</p>
				<p>
					<strong>Version 6.5.2</strong> addressed a security issue and fixed 12 bugs.					For more information, see <a href="https://wordpress.org/support/wordpress-version/version-6-5-2/">the release notes</a>.				</p>
			</div>
