				<h3 style="margin-top:calc(var(--gap) * 0.75);margin-bottom:calc(var(--gap) * 0.5)">Explore improvements to the plugin experience</h3>
				<p>
					There&#8217;s now an easier way to manage plugin dependencies. Plugin authors can supply a new <code lang="en">Requires Plugins</code> header with a comma-separated list of required plugin slugs, presenting users with links to install and activate those plugins first.				</p>
